dict.string:
ObjC.import('stdlib');

function run(argv)
{
	strNoisy = $.getenv('Noisy');
	strNoisy = strNoisy.toLowerCase();
	if(strNoisy == "true")
	{
		Application('com.runningwithcrayons.Alfred').setConfiguration('Noisy', 
		{
			toValue: "false",
			inWorkflow: $.getenv('alfred_workflow_bundleid'),
			exportable: true
		});
		return "false";
	}

	else
	{
		Application('com.runningwithcrayons.Alfred').setConfiguration('Noisy', 
		{
			toValue: "true",
			inWorkflow: $.getenv('alfred_workflow_bundleid'),
			exportable: true
		});
		return "true";
	}
}

