function run(argv) {
  let query = argv[0];
  return encodeURIComponent(query);
}

ObjC.import('stdlib');

function run(argv)
{
	Application('com.runningwithcrayons.Alfred').setConfiguration('UClastchecked', 
	{
		toValue: argv,
		inWorkflow: $.getenv('alfred_workflow_bundleid'),
		exportable: true
	});
}

# --- Functions Start ---
function connected() { if [ $(ping -c 1 -q google.com >&/dev/null; echo $?) -eq 0 ]; then echo 1 else echo 0 fi }
function checksettings() { # Initialise check frequency to weekly if not set if [ "$UCfrequency" -eq "" ]; then UCfrequency=7 fi
if [ $UCfrequency -lt 1 ]; then # If set to less than one, then don't check for updates echo 0 else # Need to do some checking # First step is calculating what our check threshold is backcheck=$(date -v -"$UCfrequency"d +%Y%m%d)
# Initialise the check date if one is not set (e.g. first time) if [ "$UClastchecked" -eq "" ]; then UClastchecked=0 fi
if [ $UClastchecked -le $backcheck ]; then # We need to check for an update echo 1 else # No need to check echo 0 fi fi }
function evalsemver() { #Split the argument into the three constituents str=$1 svlist=(${(@s:.:)str}) intMajor=$(($svlist[1] * 1000000)) intMinor=$(($svlist[2] * 1000)) intEval=$((intMajor + intMinor + $svlist[3])) echo $intEval }
function comparesemvar() { value1=$(evalsemver $1) value2=$(evalsemver $2)
if [ $value1 -gt $value2 ]; then echo 1 # $1 is newer than $2 elif [ $value1 -lt $value2 ]; then echo -1 # $1 is older than $2 else echo 0 # $1 is the same as $2 fi }
function updaterequired() { # Compare local workflow version to remote workflow version if [ $(comparesemvar $alfred_workflow_version $1) -lt 0 ]; then echo 1 else echo 0 fi }
# --- Functions End ---
# Output will be: # MODE|UClastchecked|remoteversion
# If connected to the Internet, we should consider checking for an update if [ $(connected) -eq 1 ]; then # Connected
# Check the check for update settings to see if we need to check for an update if [ $(checksettings) -eq 1 ]; then # Need to fetch and check version number
# Silently fetch the remote version from the web site remoteversion=$(curl -s https://doctordrafts.thoughtasylum.com/latestversion.txt)
# Store the current date so we can use it in the output for when the last check was done latestCheck=$(date +%Y%m%d)
# Check the check for update settings to see if we need to check for an update if [ $(updaterequired $remoteversion) -eq 1 ]; then # Need to update # echo "UPDATE|$latestCheck|$remoteversion" else # No need to update echo "NO UPDATE|$latestCheck|$remoteversion" fi
else # Checked recently, so ignore echo "DO NOT CHECK|$UClastchecked|0.0.0" fi
else # Disconnected echo "DISCONNECTED|$UClastchecked|0.0.0" fi
